import React from 'react';

function HELP() {
    return (
        <>
        <div>
        안녕하세요! 22기 단장으로 활동했던 최봉수라고 합니다 :)<br/><br/>
        페이지 사용에 대한 간단한 도움 말 드립니다!<br/>
        우선 혹시 홈페이지 자체를 수정하셔야 할 경우<br/><br/>
        <a href='https://github.com/11t518s/ukov_admin'>이곳</a>에서 클론해 가셔서 수정하시면 됩니다.<br/>
        이런저런 내용은 readme에 써뒀으니 참고 부탁드립니다.<br/>
        혹시 개발을 할 줄 모르는 단원만 있다면 010-2771-7426이 제 핸드폰 번호여서 연락주세요!<br/>
        ukov계정으로 인스타 dm주셔도 되고, 전 단장님을 통해 ukov톡방으로 연락주셔도 좋습니다 :)<br/><br/>

        일단 수정하는 것까진 구현하지 않았고, 삭제와 업로드로만 구현해뒀습니다.<br/>
        올린 순서대로 올라가게 해뒀으니 참고 부탁드립니다.<br/>


        </div>
        </>

    )
}

export default HELP;
